    daDat,
    giaVe,
    loaiGhe,
    maGhe,
    maRap,
    stt,
    taiKhoanNguoiDat,
    tenGhe,
  } = props.seatItem;
  let code = props.code;
  function ActiveSeatSelected() {}
  return (
    <React.Fragment>
      <span
        className="seat__wrapper"
        onClick={() => ActiveSeatSelected(daDat, giaVe, maGhe, tenGhe)}
      >
